(1347, 'Winter Vacations Notice', 'D/P,\r\nThe school will remain closed for winter vacations from 23rd Dec(Monday) to 5th January (Sunday).\r\nSchool will reopen from 06th January (Monday) on usual time and time table.\r\n\r\nRegards\r\nPrincipal\r\nAPS', NULL, '', '', 'topic', '', 'global', '2019-12-22 19:46:38'),
